import React, { Component } from 'react';
import './../excss.css';
import './../Css/DivSect.css';

class Imagesect extends Component {
  render() {
      return (
          <section className="sect red cf">
              <LeftInformations />
              {/* <SmallImagesect margin="left"/> */}
          </section>
      )
    }
}


  // small image + article
  class SmallImagesect extends Component {
    render() {
      const marginStyle = this.props.margin;
      const newClassName = marginStyle + 'margin flt_left smallAdImageWrap'

      return (
        <div className={newClassName}>
            <article>lorem ipsum..</article> 
            <div>디자인 요소입니다</div>      

            <div className="smallAdImage">small image part</div>
        </div>
      )
    }
  }


// Big image
class LeftInformations extends Component {
    render() {
      return (
          <div className="leftContents flt_left cf">
            <article>
              <div className="cf">
                <div className="flt_left">
                  <p className="ractBox">{this._login_Cart}</p>
                  <p className="ractBox"><a href="/"><span className="_skip">Cart</span></a></p>
                </div>
                <div className="flt_left">
                  <p className="membership"><a href="/">MemberShip</a></p>
                </div>
              </div>
              <div className="cf">
                <p className="ractBox flt_left"></p>
                <p className="ractBox flt_left"><a href="/">Buy Now</a></p>
                <p className="viewMore flt_left"><a href="/">View More</a></p>
              </div>
            </article>

            <article>
              <h3>TOTAL CLEANSER 3DAYS</h3>
            </article>
          </div>
      )
    }
    _login_Cart() {
      return(
        <a href="/"><span className="_skip">Sign in</span></a>
      )
    }
  }




  export default Imagesect;
